import React from 'react';

export default function LeftSidebar({ categories, selectedKeyword, onKeywordClick }) {
  return (
    <div>
      <h2 className="sidebar-title">Keywords</h2>
      {Object.entries(categories).map(([category, keywords]) => (
        <div key={category}>
          <h3 className="category-title">{category}</h3>
          <ul>
            {keywords.map((keyword) => (
              <li
                key={keyword}
                className={`keyword-item ${selectedKeyword === keyword ? 'selected-keyword' : ''}`}
                onClick={() => onKeywordClick(keyword)}
              >
                {keyword}
              </li>
            ))}
          </ul>
        </div>
      ))}
    </div>
  );
}
